@eweezy__ Our apologies for the frustration you’re feeling.
If you need our help, please send us a direct message with your request, your full name, reservation code and where you flew from and to.
Did you do advanced seat selection? https://t.co/o7MlHGd5Wh

@dfkpgh Our apologies for the interruption to your travel plans.
If you need help, please send us a direct message with your request, your full name, reservation code and where you're booked to fly from and to.
If you've checked baggage or have bag tags, an airport agent can help. https://t.co/o7MlHGd5Wh

@captnsdragon We can assure you we have Social Care agents working around the clock - and we have thick skin!
Our turnaround times aren't where we would like them to be, as we are experiencing record demand.
We appreciate the loyalty and understanding our guests are extending our way.

@floobish Hi There, We are glad things worked out for you. It is never our intention to disappoint our guests with flight interruptions. 
It's always good to know the rules and regulations for when plans don't go as intended: 
https://t.co/4JsgvnLX4h
